package ale.java_training;

public class HackUtils {

    public static int profitOf(int[] accounts, int n) {
      int max = Integer.MIN_VALUE;
      for (int i = 0; i < accounts.length - n + 1; i++) {
        int sum = 0;
        for (int j = i; j < i + n; j++) {
          sum += accounts[j];
        }
        if (sum > max) {
          max = sum;
        }
      }
      return max;
    }
}
